/* eslint-disable jsx-a11y/anchor-is-valid */
import React from 'react';
import './NavBar.css';
import accountIcon from '../../assets/mojekonto.svg';
import basketIcon from '../../assets/koszyk.svg';
import orderIcon from '../../assets/zamow_ikona.svg';
const NavbarClient = () => {
    return (
        <div className='client'>


            <div className='client__box box'>
                <div className='box__img'>
                    <img src={accountIcon} alt=''/>
                </div>
                <a href="#" className='box__text'>Moje konto</a>
            </div>


            <div className='client__box box'>
                <div className='box__img'>
                    <img src={basketIcon} alt=''/>
                </div>
                <a href="#" className='box__text'>Koszyk</a>
            </div>


            <div className='client__box box '>
                <div className='box__img'>
                    <svg width="16" height="12" viewBox="0 0 16 12" fill="none" xmlns="http://www.w3.org/2000/svg">
                        <g id="Group 5">
                        <path id="Path 41" fillRule="evenodd" clipRule="evenodd" d="M15 7.86446C15 7.86446 13.9306 8.1344 13.8104 9.28238C13.6902 10.4304 12.6138 11 12.6138 11H7.49899H3.11186C3.11186 11 2.42291 10.9255 2.15418 9.97062C1.88545 9.01577 2.10831 8.25 1 8.16086V7.66669H15V7.86446Z" stroke="white" strokeWidth="1.12"/>
                        <path id="Path 41 Copy" fillRule="evenodd" clipRule="evenodd" d="M15 1.19778C15 1.19778 13.9306 1.46771 13.8104 2.6157C13.6902 3.76368 12.6138 4.33333 12.6138 4.33333H7.49899H3.11186C3.11186 4.33333 2.42291 4.25879 2.15418 3.30393C1.88545 2.34908 2.10831 1.58331 1 1.49417V1H15V1.19778Z" stroke="white" strokeWidth="1.12"/>
                        </g>
                    </svg>
                </div>
                <a href="#" className='box__text'>Zam√≥w</a>
            </div>


        </div>
    )
}

export default NavbarClient;
